I had a quick look at this, using the little snippet below.

I tried a few things (namely, overriding getAccessible in the Browser widget so that CreateStdAccessibleObject is called for its frame or site instead of itself). Using 'site' helped a little, but not enough. I would need to reach deeper into the OS to find the correct handle to pass to CreateStdAccessibleObject.

At first glance, I believe that this is not an easy fix.
How important is it?

import org.eclipse.swt.*;
import org.eclipse.swt.widgets.*;
import org.eclipse.swt.browser.*;
import org.eclipse.swt.layout.*;
import org.eclipse.swt.accessibility.*;

public class AccessibleBrowserTest {
	static Display display;
	static Shell shell;
	static Browser browser, overrideBrowser;

	public static void main(String[] args) {
		display = new Display();
		shell = new Shell(display);
		shell.setLayout(new FillLayout());
		shell.setText("Browser Test App");

		browser = new Browser(shell, SWT.PUSH);
		browser.setText("Browser 1");

		overrideBrowser = new Browser(shell, SWT.PUSH);
		overrideBrowser.setText("Browser 2");
		overrideBrowser.getAccessible().addAccessibleListener(new AccessibleAdapter() {
			public void getName(AccessibleEvent e) {
				e.result = "This is the get_accName for Browser 2";
			}
		});

		shell.pack();
		shell.open();
		while (!shell.isDisposed()) {
			if (!display.readAndDispatch()) display.sleep();
		}
		display.dispose();
	}
}

3.3M4

The following snippet takes a couple of seconds to run on my machine if I substitute Text for StyledText.  However with StyledText it appears to hang (it would probably finish eventually, but after a couple of minutes I stopped it).

public static void main(String[] args) {
    Display display = new Display ();
    Shell shell = new Shell(display);
    shell.setBounds(10,10,300,300);
    final StyledText text = new StyledText (shell, SWT.MULTI | SWT.V_SCROLL | SWT.WRAP);
    text.setBounds(10,10,280,200);
    int count = 0;
    String[] strings = new String[7];
    for (int i = 0; i < 7; i++) {
        String string = "";
        for (int j = 0; j <= i; j++) {
            string += (char)(65 + j);
        }
        strings[i] = string;
    }
    int index = 0;
    final StringBuffer buffer = new StringBuffer();
    while (count < (1024 * 1024 * 1.3)) {
        buffer.append(strings[index++]);
        buffer.append(" ");
        count += index;
        if (index == 7) index = 0;
    }
    shell.open ();
    text.setText(buffer.toString());
    while (!shell.isDisposed ()) {
        if (!display.readAndDispatch ()) display.sleep ();
    }
    display.dispose ();
}

