(In reply to comment #38)

A conference call was held today with Joe, Mark, Duwayne and myself to code review the implementation.  A few comments/questions remain from that call:

Questions:
-Has this fix been tested for multiple clients (e.g. two Eclipse workbenches recording at the same time) including starting, terminating, and completing a unique recording?
-Has this fix been tested with IE 6 on XP and Vista?
-How will zipping the org.eclipse.hyades.test.core plug-in affect loading the blank.html and DLL?
-Where will the source code for the DLL be stored in CVS?
-What will be the final name for the DLL?  I have no preferences as long as it is descriptive and generic (e.g. TPTPRegistryUpdater.dll or similar).
-What test cases have been added to the test bucket to exercise each code path (start , stop, and finish, recording with one/two clients with IE 6 and IE 7) on Vista, XP, and Linux?
-Are all info/error messages externalized?  Do all error messages have IDs?  Have all debug messages (e.g. std out and err) removed?
-Why do you write the new registry settings to a local file?

Comments:
-Store the files containing the old registry settings to the user's temporary directory (e.g. System.getProeprty("java.io.tmpdir") or File.createTempFile()).
-Consider creating the blank.html at run-time and writing it to the user's temporary directory (e.g. System.getProeprty("java.io.tmpdir") or File.createTempFile()).  This would eliminate any problems if this plug-in is zipped. If not, create a folder for the file instead of the plug-in's root directory.
-The checkOSVersion() method on the Java side needs to be modified to do the following:

if Vista{
  if DLL found {
    if(run as administrator){
      use original code path;
    }
    else{
      use DLL;
    }
  }
  else{
    dialog with work-around (e.g. run as administrator);
  }
}
else{
  use original code path;
}

-Use the standard Java notation for naming methods (e.g. first letter is lowercase and all proper nouns are title case).
-Change the <description> of the manifest to something more descriptive than 'who cares'.
-The copyright comment needs to be added to all new files (see http://www.eclipse.org/tptp/home/documents/process/development/copyright.html).  
-The copyright dates needs to be updated for all existing files.
-Please update the hours worked for this defect (as accurate as possible).
-Please attach the complete patch to the Bugzilla.
-Submit a defect questionnaire to the Test Project mailing list for project/PMC approval (see http://www.eclipse.org/tptp/home/documents/process/development/stop_ship_template.html).
-Once this defect is fixed, the two readme entries can be removed in 4.5 since the 4.4.x readme is still required for 4.4.0.
-Ensure all new APIs are marked internal or provisional (see http://www.eclipse.org/tptp/home/documents/process/development/api_contract.html).
-We should consider using the same solution for IE on XP and Vista.  Please open a defect to merge both code paths.

Thanks Duwayne for all the effort (triage, investigation, design, implementation, debugging, testing, etc.) you have made on this defect.

Updated patches for this defect fix.  In org.eclipse.hyades.execution.recorder.Recorder.java, I needed to add a public method as follows:

/**
	 * 
	 * returns the active recorder client application adapter
	 */
	public RecorderClient getRecorderClient(){
		return client;
	}


I needed this to access the InternetExlorerAdapter from the DataProcessor.  Technically, this is adding public API, but it is really a very minor API that perhaps other application adapter writers may find useful.  I would hope that we could add this very minor change without too much churn.

